import React from 'react';
import './Toolbar.css';
import NavigationItems from '../NavigationItems/NavigationItems';
import DrawerToggle from '../SideDrawer/DrawerToggle/DrawerToggle';


const toolbar = ( props ) => (
    <header className="Toolbar">
        <DrawerToggle>
            <div className="Logo">
                <Logo/>
            </div>
        </DrawerToggle>
        <nav>
            <NavigationItems/>
        </nav>
    </header>
);

export default toolbar;
